class LinkedList<T : Comparable<T>> {
    private var head: Node<T>? = null

    fun add(value: T) {
        val newNode = Node(value)
        if (head == null) {
            head = newNode
        } else {
            var current = head
            while (current?.next != null) {
                current = current.next
            }
            current?.next = newNode
        }
    }

    fun reverseRecurrsive() {
        head = reverseRecurrsive(head)
    }

    private fun reverseRecurrsive(node: Node<T>?): Node<T>? {
        if (node?.next == null) {
            return node
        }
        val last = reverseRecurrsive(node.next)
        node.next?.next = node
        node.next = null
        return last
    }

    override fun toString(): String {
        var current = head
        val sb = StringBuilder()
        while (current != null) {
            sb.append(current.value)
            sb.append(" ")
            current = current.next
        }
        return sb.toString()
    }

    private class Node<T>(val value: T) {
