class SegmentTree(arr: Array<Int>) {
    private val tree = Array(arr.size * 4) { 0 }
    private val n = arr.size

    init {
        build(1, 0, n - 1, arr)
    }

    private fun build(v: Int, l: Int, r: Int, arr: Array<Int>) {
        if (l == r) {
            tree[v] = arr[l]
            return
        }
        val mid = (l + r) / 2
        build(v * 2, l, mid, arr)
        build(v * 2 + 1, mid + 1, r, arr)
        tree[v] = tree[v * 2] + tree[v * 2 + 1]
    }

    fun getSum(l: Int, r: Int): Int {
        return getSum(1, 0, n - 1, l, r)
    }

    private fun getSum(v: Int, l: Int, r: Int, left: Int, right: Int): Int {
        if (left > r || right < l) return 0
        if (left <= l && right >= r) return tree[v]
        val mid = (l + r) / 2
        val sumLeft = getSum(v * 2, l, mid, left, right)
        val sumRight = getSum(v * 2 + 1, mid + 1, r, left, right)
        return sumLeft + sumRight
    }
}

