class SolutionLCP13 {
    fun minimalSteps(maze: Array<String>): Int {
        val m = maze.size
        val n = maze[0].length
        val visited = Array(m) { BooleanArray(n) }
        val queue = ArrayDeque<Pair<Int, Int>>()
        queue.add(Pair(0, 0))
        visited[0][0] = true
        var steps = 0
        while (queue.isNotEmpty()) {
            val size = queue.size
            for (i in 0 until size) {
                val (x, y) = queue.removeFirst()
                if (x == m - 1 && y == n - 1) return steps
                for (dx in -1..1) {
                    for (dy in -1..1) {
                        if (dx != 0 && dy != 0) continue
                        var nx = x + dx
                        var ny = y + dy
                        while (nx in 0 until m && ny in 0 until n && maze[nx][ny] == '.') {
                            nx += dx
                            ny += dy
                        }
                        nx -= dx
                        ny -= dy
                        if (!visited[nx][ny]) {
                            visited[nx][ny] = true
                            queue.add(Pair(nx, ny))
                        }
                    }
                }
            }
            steps++
        }
        return -1
    }
}

